sys_variable_value.value:
(function execute(inputs, outputs) {
    var sat = new GlideRecord('x_1387186_sat_img_satellite_images');
    sat.addQuery('sys_id', inputs.satellite);
    sat.query();
    outputs.clearance_level = sat.getValue('clearance_level');
})(inputs, outputs);

